    {ntt"total": 3,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-20T03:20:47.653758",nt"name": "or-shorelines-shp-shorelines-of-the-oregon-coastal-region-used-in-shoreline-change-analysis",nt"isopen":
    false,nt"url": null,nt"notes": "Sandy ocean beaches are a popular recreational
    destination, often surrounded by communities containing valuable real estate. Development
    is on the rise despite the fact that coastal infrastructure is subjected to flooding
    and erosion. As a result, there is an increased demand for accurate information
    regarding past and present shoreline changes. To meet these national needs, the
    Coastal and Marine Geology Program of the U.S. Geological Survey (USGS) is compiling
    existing reliable historical shoreline data along open-ocean sandy shores of the
    conterminous United States and parts of Alaska and Hawaii under the National Assessment
    of Shoreline Change project. There is no widely accepted standard for analyzing
    shoreline change. Existing shoreline data measurements and rate calculation methods
    vary from study to study and prevent combining results into state-wide or regional
    assessments. The impetus behind the National Assessment project was to develop a
    standardized method of measuring changes in shoreline position that is consistent
    from coast to coast. The goal was to facilitate the process of periodically and
    systematically updating the results in an internally consistent manner.",nt"license_title":
